column8:
「オートデコール」ファッションカーテンは、フィルムに替わる次世代商品であり、運転席・助手席の窓枠を利用して取り付ける画期的なアイテム。ファッション性と機能性を兼ね備え紫外線・プライバシーからあなたをお守りします。 <br><br>車の窓枠の形状に合わせ、カーテン本体は左右高さの違うカット縫製で、弛みがなく、設計の特殊形状フック・レールを使用しており、滑りが良く、ピタッと簡単に取り付けられます。レールに、ゴムストッパー付きです。お好みの位置で簡単にカーテンを止めることができます。プラスチック材料はABS 樹脂、窓枠に貼る接着テープは3M 品を使用。夏の温度高い車内にも対応可能です。<br><br>※実際にお車の窓枠サイズ・取り付け位置をご確認の上、ご注文ください。※窓枠の高さが「42.5ｃｍ」などのサイズギリギリの場合は、１つ上のサイズをお選びください。 <br><br>窓枠の高さ　42～47cm <br><br>インテリア/インテリアその他<tr><td colspan="2">
