日本国内のみならず世界的にもＶＩＰカースタイルを牽引し続ける「JUNCTION PURODUCE」。非常に上品で有りつつも、強烈な個性放ち続けるこのJUNCTION PURODUCEの製品は非常にクオリティが高い事が特徴です。Text by alfa<br><br>開発ポリシーは「超スタンダード＆超オーソドックス」で敢えてカラーもブラックのみで、シルバーステッチのベルトロゴのみが車外に存在をアピールします。しかし、汎用レザー調カーテンベルト(別売)の換装により表情を一新させるオプションも用意。オプションで汎用カーテンベルトとも組み合わせて頂けます。伸縮性バツグンの素材で様々な車種にピッタリ装着！プライバシー保護！UVカット＆冷暖房への効果もバツグン！<br><br>カラー：ブラック　　※S・・・タテ39cmXヨコ50cm（窓枠高さ37～41cm用）※付属カーテンレールは上下用共に50cm　　注意：窓枠のない車種には取付できません。<br><br>ユニバーサル<br><br><br><br>インテリア | インテリアその他<br>※こちらの商品は代引き不可となります<tr><td colspan="2">
