本製品にはカーテン本体は含まれておりません。必要の場合には併せてお買い求めください。<br>
■タイプ：モノグラムレザー<br>
■カラー：ブラック/ベージュ<br><br>

【 型押しD.A.Dモノグラム 】<br>
彫り深く型押しされたD.A.Dモノグラムが圧倒的な存在感を演出。<br><br>
【 D.A.D DCエンブレム 】<br>
D.A.D DCエンブレムが際立った存在感を醸し出します。<br><br>
【 D.A.Dデザインレザーバッチ 】<br>
艶のあるレザーを大きめのステッチで縁どり、D.A.Dロゴをあしらった高級感溢れるカーテンバッチを採用しています。<br>
柔らかなレザーとクッション材をカーテンバッチ内部に折り込むことで、柔らかな手触りはもちろんのこと、窓との接触による不快な音を和らげる効果もあります。<br><br>
※バッチ裏面にはホックが左右2個づつ計4個装備されており、簡単に外れることなく、カーテンをしっかりと束ねることができます。<br><br>
※「カーテンラインストーン」は付属しておりません。別売りにて販売を行っております。<br>







